import { Switch,Route,Link,Redirect } from 'react-router-dom';
import './App.css';
import Home from './views/Home';

function App() {
  return (
    <div className="App">
      <nav>
        <Link to="/">Home</Link>
        <Link to="/new">Create </Link>
      </nav>

      <Switch>
        <Route exact path="/pirates">
          <Home />
        </Route>

        {/* ERROR */}
        <Route exact path="/404">
          <Error />
        </Route>

        <Route><Redirect to="/404" /></Route>
      </Switch>
    </div>
  );
}

export default App;
